messages__text:
Зафиксировав несколько десятков тысяч нарушений на выборах, белорусы услышали от Ермошиной и других прикорытников традиционное «что-то не нравится – идите в суд». Сходили:

❌ Прокуратура любые жалобы на выборы перенаправляет в избирательные комиссии (те самые, которые с бандитской наглостью украли ваши голоса);

❌ Милиция и следователи отказываются возбуждать уголовные дела по фальсификации выборов, ссылаясь на то что избирательными комиссиями нарушений не выявлено;

❌Верховный Суд отказывается принимать жалобы на решения ЦИК.
